import { createBrowserRouter } from "react-router-dom";
import HomePage from "./pages/Home";

const router = function App() {
  createBrowserRouter( // 하나의 객체가 곧 하나의 라우터
    {path: '/', element: <HomePage/>},
  )
  return <div></div>;
}

export default App;
